import css from './'
import { FriendListItem } from './FriendListItem/FriendListItem'
//  console.log('sdfsdf')
export const  FriendList = ({ friends }) => {
   
    return <ul className={css.list}>
        {friends.map(({avatar, name, isOnline, id}) => {
          return <FriendListItem 
          avatar={avatar}
          name={name}
          isOnline={isOnline}
          id={id}
          />
        })}
    </ul>
}
